oxy_webhelp_navlinks = {"con_troubleshooting-d4802e3538":{"topics":[{"title":"How do I remove an address from Recent Contacts?","shortdesc":"<p class=\"shortdesc\">When you address an email, if an incorrect address appears in the type-ahead list, you can hide it. In the type-ahead list or the Recent Contacts view, right-click the address and then select <span class=\"ph uicontrol\">Hide in Recent Contacts<\/span>.<\/p>","href":"con_remove_recent_contact_t.html","attributes":{"data-id":"con_remove_recent_contact_t.dita"},"menu":{"hasChildren":false},"tocID":"con_remove_recent_contact_t.dita-d4802e3549","topics":[]},{"title":"Why are there no chats in my collaboration history?","shortdesc":"<p class=\"shortdesc\">If you have not chosen to save chats to your mail file, then no chats will appear in your collaboration history.<\/p>","href":"con_no_chats_t.html","attributes":{"data-id":"con_no_chats_t.dita"},"menu":{"hasChildren":false},"tocID":"con_no_chats_t.dita-d4802e3564","topics":[]},{"title":"Why are there no contacts in <span class=\"ph uicontrol\">By Company<\/span> or <span class=\"ph uicontrol\">Birthdays and Anniversaries<\/span>?","shortdesc":"<p class=\"shortdesc\">If you have not completed a <span class=\"ph uicontrol\">Company<\/span>, <span class=\"ph uicontrol\">Birthday<\/span>, <span class=\"ph uicontrol\">Anniversary<\/span>, or <span class=\"ph uicontrol\">Category<\/span> for any contacts, then no contacts will appear in those views.<\/p>","href":"con_no_company_birthday_t.html","attributes":{"data-id":"con_no_company_birthday_t.dita"},"menu":{"hasChildren":false},"tocID":"con_no_company_birthday_t.dita-d4802e3575","topics":[]}]}};